INSERT INTO `galeri` (`galeri_id`, `album_id`, `galeri_title`, `tipe`, `image`, `description`, `upload_date`) VALUES
(1, 2, '12 Kepala Daerah Kum', 'Foto', '20150729191.jpg', 'Berlokasi di Green Graden Cefe Kebun Raya Bogor, Walikota Bogor Bima Arya menerima dan menjamu para tamu undangan dari 10 Kota dan Kabupaten terkait isu perubahan iklim, pada  Senin (15/6). ', '2015-07-29'),
(2, 2, '12 Kepala Daerah Sep', 'Foto', '20150729500.jpg', 'Pertemuan Informal Kepala Daerah Untuk Pembangunan Yang Berkelanjutan menghasilkan kesepakatan yang tertuang dalam Tri Karsa Bogor. ', '2015-07-29'),
(3, 2, 'Penanaman Pohon dan ', 'Foto', '20150729968.jpg', 'Sebanyak 233 orang Calon Pegawai Negeri Sipil (CPNS) Tahun  2014 melakukan kegiatan aksi penanaman pohon ', '2015-07-29'),
(4, 4, 'Bahan Bakar Ramah Li', 'Foto', '20150729865.jpg', 'BPLH Kota Bogor Targetkan 96 Ribu Liter Minyak Jelantah Terkumpul Setahun', '2015-07-29'),
(5, 2, 'Penyerahan Adiwiyata', 'Foto', '20150803840.jpg', 'SDN Lawang Gintung 2 dan SMPN 6 Bogor Raih Adiwiyata Mandiri (5/6).', '2015-08-03'),
(6, 2, 'Pelantikan Dewan Sak', 'Foto', '20150803884.jpg', 'Pelantikan Dewan Saka dan Anggota Baru Saka Wanabakti Kota Bogor  untuk melestarikan dan menjaga alam dan lingkungan hidup (20/7).', '2015-08-03'),
(7, 2, 'Jalan Sehat ', 'Foto', '20150803173.jpg', 'Pesertanya sebanyak 12 RW dan kriteria yang akan dinilai tentunya kebersihan lingkungan dengan tim jurinya gabungan dari kelurahan, LPM dan perwakilan dari tokoh masyarakat (27/5).', '2015-08-03'),
(9, 3, 'Walikota Jumsih Di A', 'Foto', '2015080341.jpg', 'Walikota Bogor Dr. Bima Arya bersama jajaran Muspida melakukan aksi Jumat Bersih (Jumasih) di area sekitar Jalan Otto Iskandar dan Kebun Raya Bogor (13/6).', '2015-08-03'),
(10, 2, '233 CPNS Kota Bogor ', 'Foto', '20150803488.jpg', 'Sebanyak 233 orang Calon Pegawai Negeri Sipil (CPNS) Tahun  2014 melakukan kegiatan aksi penanaman pohon gerakan penghijauan disepanjang Jalan R3 Katulampa Kecamatan Bogor Timur (11/1).', '2015-08-03'),
(11, 3, 'Seminar KTR', 'Foto', '20150803832.jpg', 'Guna meningkatkan kesadaran para remaja tentang bahaya merokok dan penerapan Kawasan Tampa Rokok (KTR) di Kota Bogor (15/12).', '2015-08-03'),
(12, 2, 'Jalan Sehat Peduli L', 'Foto', '20150803988.JPG', 'Keluarga besar SMPN 5 Bogor ingin mensosialisasikan program ini kepada masyarakat dengan tingkah laku. Anak-anak diajar berfikir dan didorong untuk bertindak positif yang dikaitkan dengan hirar ke-3 yaitu hejo yang artinya ci', '2015-08-03'),
(13, 2, 'Aksi Hejo Barudak Sp', 'Foto', '20150803357.jpg', 'Kegiatan ini merupakan implementasi dukungan terhadap gerakan yang  dicanangkan pemerintah sekaligus mendidik anak-anak mencintai dan menjaga lingkungan dengan menjaga ketersediaan air tanah (14/4).', '2015-08-03'),
(14, 2, 'Aksi Jumsih Ciptakan', 'Foto', '20150803402.jpg', 'Selain berdampak positif bagi lingkungan, kegiatan Jumsih juga sangat bermanfaat bagi kesehatan badan, maka saya imbau tidak hanya di instansi, tapi seluruh elemen masyarakat juga harus mencanangkan program Jumsih (13/2).', '2015-08-03'),
(15, 3, 'Vandalisme Rusak Kei', 'Foto', '20150803746.jpg', 'Walikota Bogor Bima Arya, melakukan aksi bersih-bersih dengan mengecat tembok di lokasi underpass Kebun Raya Bogor (21/7).', '2015-08-03'),
(16, 3, 'Bank Sampah ', 'Foto', '20150803983.jpg', 'Mengubah gaya hidup masyarakat dengan memilah sampah dirasa mampu menjadi solusi. Sampah rumah tangga terdiri dari 67% sampah organik yang bisa dimanfaatkan menjadi kompos (3/10).', '2015-08-03'),
(17, 2, 'Bima Minta PDAM Bant', 'Foto', '20150803242.jpg', 'Walikota Bogor, Bima Arya meminta PDAM Tirta Pakuan untuk turut membantu warga yang menghadapi kekeringan dengan memberikan bantuan air bersih secara cuma-cuma. Hal ini disampaikan Bima ketika hadir pada acara Halal Bi Halal ', '2015-08-03'),
(18, 2, 'Bima Sampaikan Konse', 'Foto', '20150803343.JPG', 'Walikota Bogor Bima Arya berkesempatan menyampaikan konsep Bogor Green City yang sekaligus membuka secara resmi salah satu Plenary Sessions (29/7).', '2015-08-03'),
(19, 2, 'Manfaat Lubang Biopo', 'Foto', '20150803978.jpg', 'Lubang bipori sebagai wujud kepedulian lingkungan agar Kota Bogor semakin hijau dan nyaman (13/2).', '2015-08-03'),
(20, 2, 'Penanaman Pohon', 'Foto', '20150803936.jpg', 'Penanaman bukan untuk pencitraan. Penanaman bukan untuk keindahan semata. Tetapi, penanaman ini untuk generasi masa depan dan penanaman pembangunan peradaban. Jadi bukan hanya acara simbolis, tapi gerakan kalau kita semua ber', '2015-08-03'),
(21, 3, 'Bioresources ', 'Foto', '20150803229.jpg', 'Acara ini bertujuan membuka wawasan dan pengetahuan tentang pemanfaatan Bioresources atau sumber daya alam hayati di Indonesia. Yang apabila dimanfaatkan sangat berguna untuk kemakmuran dan daya saing Indonesia di kancah inte', '2015-08-03'),
(22, 2, 'Tangani Sampah Dari ', 'Foto', '2015080348.jpg', 'Warga Kota Bogor, kita budayakan memilah dan memilih sampah. Inilah yang sulit.  Namun, bagaimanapun juga kita akan tetap mengedukasi dan meyakinkan warga untuk memilih dan memilah sampah mulai dari lingkungannya, utamanya da', '2015-08-03'),
(23, 2, 'BPLH Peringatan Hari', 'Foto', '20150803677.jpg', 'Dalam rangka peringatan hari lingkungan hidup tahun 2015 sekaligus Hari Jadi Bogor (HJB) ke-533, Badan Pengelolaan Lingkungan Hidup (BPLH) Kota Bogor menggelar berbagai kegiatan (17/5).', '2015-08-03'),
(24, 2, 'Walikota Buat Terobo', 'Foto', '20150803570.jpg', 'Walikota Bogor, Bima Arya selama hampir seminggu berada di Negeri Ginseng untuk memenuhi undangan Internasional Council for Local Environmental Initiative (ICLEI) untuk hadir pada forum ICLEI World Congress 2015 di Seoul, Kor', '2015-08-03'),
(25, 3, 'Penanggulangan Asap ', 'Foto', '20150803191.jpg', 'Menurut berbagai penelitian epidemiologi, masalah penanganan PTM dan faktor resikonya justru terjadi pada masyarakat golongan sosial ekonomi rendah. Kematian akibat  PTM  di negara-negara maju terus menurun, sebaliknya di neg', '2015-08-03'),
(26, 3, 'DKP Gelar Workshop P', 'Foto', '20150803113.jpg', 'Pemerintah Kota Bogor melalui Dinas Kebersihan dan Pertamanan (DKP) Kota Bogor menggelar Workshop peran serta pelaku usaha dalam pengelolaan sampah di Kota Bogor di lapangan Astrid Kebun Raya Bogor (26/11).', '2015-08-03'),
(27, 2, 'Lomba Mulung Runtah', 'Foto', '20150803221.jpg', 'Dalam rangka memeriahkan Hari Jadi Bogor Ke-533, Pemerintah Kota Bogor bekerja sama dengan Komunitas Pecinta Ciliwung (KPC ) Kota Bogor menggelar Lomba Mulung Sampah Ciliwung Ke-7 (28/5).', '2015-08-03'),
(28, 3, 'Wujudkan Kota Hijau', 'Foto', '20150803252.jpg', 'Untuk mewujudkan Kota Bogor menjadi smart city yang berwawasan lingkungan tanpa meninggalkan nilai heritage yang ada (4/9).', '2015-08-03'),
(29, 2, 'Festival Hijau', 'Foto', '20150803324.jpg', 'Forum komunikasi ini merupakan gabungan dari berbagai momunitas hijau di Kota Bogor, yang mempunyai visi hijau untuk mewujudkan Kota hijau yang berkelanjutan disaat ini anggota forum komunitas hijau terdiri dari beberapa orga', '2015-08-03'),
