INSERT INTO `post` (`post_id`, `user_id`, `category_id`, `title`, `body`, `post_date`, `date_publish`, `view`, `status`, `image`) VALUES
(12, 4, 10, 'Sekapur Sirih', '<p><img alt="Kepala Bandan Pengelolaan Lingkungan Hidup" src="http://localhost/uploads/content/images/KepalaBadan.jpg" style="float:left; height:200px; margin:5px; width:150px" />Puji serta syukur kami panjatkan kehadirat Allah SWT, berkat limpahan Rahmat dan Karunia-Nya, website Badan Pengelolaan Lingkungan Hidup Kota Bogor dapat terwujud.</p>\r\n\r\n<p>Website &nbsp;Badan Pengelolaan Lingkungan Hidup Kota Bogor sebagai sumber informasi tentang keadaan lingkungan hidup dan Satuan Kerja Perangkat Daerah Badan Pengelolaan Lingkungan Hidup Kota Bogor serta selayang pandang pembangunan Lingkungan Hidup di Kota Bogor</p>\r\n\r\n<p>Atas kerjasama yang baik dari semua pihak yang membantu memperlancar selesainya penyusunan website Badan Pengelolaan Lingkungan Hidup Kota Bogor, kami ucapkan terima kasih.</p>\r\n\r\n<p>Semoga website Badan Pengelolaan Lingkungan Hidup Kota Bogor ini dapat dijadikan sebagai bahan informasi yang berguna bagi kemajuan pembangunan Lingkungan Hidup.</p>\r\n', '2016-08-23 02:02:33', '2015-01-01', 0, 1, ''),
(13, 5, 7, ' Kota Bogor Berkomitmen Pembangunan Berkelanjutan Lingkungan Hidup', '<p><img alt="" src="http://bplh.kotabogor.go.id/uploads/content/images/berita1.jpg" style="float:left; height:174px; margin-left:5px; margin-right:5px; width:282px" />Memperingati Hari Lingkungan Hidup, Walikota Bogor Dr. Bima Arya melepas 532 burung berbagai jenis di Kebun Raya Bogor Kamis (5/6). Pelepasan burung dilakukan sebagai simbol kepedulian terhadap kelestarian lingkungan hidup.</p>\n\n<p>Kegiatan pelepasan burung ini diselenggarakan DPD KNPI Kota Bogor bekerja sama dengan Dinas Pendidikan Kota Bogor. Sebelum pelepasan burung acara diawali long march mulai dari sekretariat KNPI di Gor Pajajaran menuju Kebun Raya Bogor. Long march diikuti oleh ratusan pelajar SMA dan SMK se-Kota Bogor. Hujan gerimis yang memayungi pelajar selama perjalanan tidak menyurutkan semangat mereka untuk terus berjalan menuju Kebun Raya.</p>\n\n<p>Pada kesempatan tersebut para pelajar menyampaikan 5 petisi yang intinya mengharapkan pemerintah Kota Bogor harus memperhatikan lingkungan agar Kota Bogor lebih sejuk, segar dan nyaman.</p>\n\n<p>&ldquo;Kita sudah berkomitmen mengenai pembangunan yang berkelanjutan dalam hal lingkungan. Pelepasan burung ini sebagai simbol keseriusan kita dan kepedulian kita terhadap kelestarian lingkungan dan strategi pembangunan yang ramah lingkungan. Kedepan tidak ada lagi izin yang melanggar perda,&rdquo; tegas Bima.</p>\n\n<p>Ketua DPD KNPI Kota Bogor Hasbulloh mengatakan bahwa tujuan dari kegiatan hari ini adalah untuk mengirimkan pesan dari para pelajar dan pemuda kepada penyelenggara pemerintahan yaitu walikota beserta jajarannya untuk memperhatikan lingkungan dan menjaga kebersihan. (Tria S/Agus)<br />\nEditor : Dian Intannia</p>\n', '2015-12-23 09:10:03', '2014-06-06', 49, 1, ''),
(14, 4, 7, 'Walikota Jumsih Di Area Otista dan Kebun Raya ', '<p><img alt="" src="http://bplh.kotabogor.go.id/uploads/content/images/jumsihotosta-01.jpg" style="float:left; height:148px; margin-left:5px; margin-right:5px; width:197px" />Walikota Bogor Dr. Bima Arya bersama jajaran Muspida melakukan aksi Jumat Bersih (Jumasih) di area sekitar Jalan Otto Iskandar dan Kebun Raya Bogor, Jumat (13/6/2014). Aksi jumsih juga dilakukan untuk memantau progres penataan kota berjalan dengan baik.<br />\r\nAksi bebersih dilakukan bersama-sama dengan Sekretaris Daerah Kota Bogor Ade Sarip Hidayat, Dan Rem 061/SK Kol. Inf. Eko. Margiyono, DanDim 0606 Kota Bogor Letkol ARH Rakhmad Santoso, serta para pelajar, mahasiswa, relawan-relawan dan instansi terkait.<br />\r\nPada kesempatan itu Bima menegaskan kembali keinginannya untuk melakukan monitoring titik utama kebersihan kota. &ldquo;Jadi memulai dari sini, kita pastikan program penataan itu berjalan dengan baik. Selain Kebun Raya, jadi kita terus-terusan sebelum ini betul-betul tertib,&rdquo; ungkap Bima.</p>\r\n\r\n<p>Bima menegaskan bahwa persoalan yang dihadapi sekarang bukan persoalan fisik, tetapi perilaku. Bagaimana merubah perilaku dan kebiasaan menjaga kebersihan di lingkungan sekitar.</p>\r\n\r\n<p>&ldquo;Alhamdulilah Jum&rsquo;at bersih ini berkolaborasi bekerjasama dan didukung penuh oleh Muspida. Ada Danrem, Dandim 0606 Kota Bogor dengan jajarannya, Kodim, Danramil, Babinsa, karena program pentaan Kota ini, tidak bisa sendiri melibatkan berbagai macam elemen, dan hari ini bergabung bersama kita tidak hanya saja Dinas tekait internal, tapi juga Korem Surya Kencana beserta jajarannya dan juga pelajar, Mahasiswa dan Relawan-Relawan Debu Cinta,&rdquo; papar Bima.</p>\r\n\r\n<p><span style="line-height:1.6em">Sementara itu, Danrem 061/SK Kol. Inf. Eko. Margiyono menyampaikan bahwa pada prinsipnya mereka ingin membantu Pemda dalam menata ketertiban, kerapihan, dan kebersihan untuk kegiatan Jumsih.</span></p>\r\n\r\n<p>&ldquo;Ini memang sengaja kita membantu pemda, karena memang pemda ingin ada membersihkan khususnya di daerah jl. Otista ini sepanjang jalur Otista ini. Sehingga sekali lagi bahwa kita ingin mendorong masyarakat supaya membuang sampah itu pada tempatnya. Sehingga kebersihan kerapihan keindahan Kota Bogor itu akan tercipta sesuai dengan program Walikota,&rdquo; ungkap Eko.</p>\r\n\r\n<p>Eko berharap agar Bogor bersih, Korem juga berperan dalam membantu program pembentukan lingkungan hidup, penanaman pohon dan pembuatan lubang resapan biopori.</p>\r\n\r\n<p>&ldquo;Pagi Jum&rsquo;at bersih ini kita hanya untuk membantu pemda didalam rangka bersih-bersih supaya masyarakat mau peduli, kerja mau merapikan sementara masyarakat ikut ada kepedulian ini bagian memghidupkan dimasyarakat untuk budaya tertib dan bersih,&rdquo; ajak Eko.(Gus/Met)<br />\r\nEditor : Dian Intannia</p>\r\n', '2016-08-23 06:42:26', '2014-06-13', 24, 1, ''),
(15, 5, 11, 'Struktur Organisasi', '<p><img alt="" src="http://bplh.kotabogor.go.id/uploads/content/images/so_badanpengelolaanlh.JPG" style="width:100%" /></p>\n\n<p>1. Kepala Badan;</p>\n\n<p>2. Sekretariat, membawahkan :</p>\n\n<ul>\n	<li>Sub Bagian Umum dan Kepegawaian;</li>\n	<li>Sub Bagian Keuangan;</li>\n	<li>Sub Bagian Perencanaan dan Pelaporan.</li>\n</ul>\n\n<p>3. Bidang Tata Lingkungan dan Dampak Lingkungan , membawahkan :</p>\n\n<ul>\n	<li>Sub Bidang Dampak Lingkungan;</li>\n	<li>Sub Bidang Penegakan Hukum dan Kemitraan.</li>\n	<li>Bidang Pengendalian Pencemaran Lingkungan dan Pengelolaan Lingkungan, membawahkan :</li>\n</ul>\n\n<p>4. Sub Bidang Pengendalian Pencemaran;<br />\n5. Sub Bidang Konservasi dan Rehabilitasi Lingkungan</p>\n\n<p>&nbsp;</p>\n', '2015-12-23 09:06:19', '2015-01-03', 0, 1, ''),
(16, 5, 7, '10 Posyandu di Kelurahan Katulampa Terima Bantuan dari Kementrian PU RI', '<p><img alt="" src="http://bplh.kotabogor.go.id/uploads/content/images/ski10.jpg" style="float:left; height:184px; margin:5px; width:300px" />Direktorat Penataan Bangunan dan Lingkungan Kementrian Pekerjaan Umum Republik Indonesia memberikan bantuan peralatan kesehatan, peralatan kesehatan ini diberikan kepada 10 posyandu yang berada di wilayah Kelurahan Katulampa Kecamatan Bogor Timur. Acara panyerahan secara simbolis kepada salah satu ketua posyandu dilaksanakan di Gedung Poetri Komplek SKI (Sumber Karya Indah) Kelurahan Katulampa Kecamatan Bogor Timur, Sabtu (20/9).</p>\n\n<p>Bantuan diserahkan langsung oleh Direktur Penataan Bangunan dan Lingkungan Ajar Prayudi yang disaksikan Kepala Badan Pengelola Lingkungan Hidup (BPLH) Kota Bogor Lilis Sukartini, Camat Bogor Timur Taufik, Lurah Katulampa Anwar Hadi, Ketua LPM, dan jajaran kader posyandu sekelurahan Katulampa serta sejumlah staf Kementrian Pekerjaan Umum Direktur Direktorat Penataan Bangunan dan Lingkungan.</p>\n\n<p>Ajar Prayudi mengatakan bantuan ini diberikan sebagai bentuk kepedulian pemerintah khususnya Kementrian Pekerjaan Umum untuk membantu posyandu di wilayah Kelurahan Katulampa Kecamatan Bogor Timur. Harapan kami &nbsp; bantuan tersebut dapat bermanfaat untuk digunakan mengganti peralatan yang sudah tidak layak lagi.</p>\n\n<p><img alt="" src="http://10.10.1.86/ci-bplh/uploads/content/images/ski14.jpg" style="height:384px; margin:5px; width:500px" /></p>\n\n<p>Sementara itu Lurah Katulampa &nbsp;mengatakan sangat berterima kasih kepada Direktorat Penataan Bangunan dan Lingkungan Kementrian Pekerjaan Umum Republik Indonesia yang telah memberikan &nbsp;bantuan peralatan kesehatan bagi 10 posyandu di wilayahnya.</p>\n\n<p>&ldquo;Pada intinya saya menyambut baik kegiatan sosial ini dan atas nama pemerintah Kota Bogor dan warga masyarakat Kelurahan Katulampa saya ucapkan terima kasih. Semoga bantuan ini bisa bermanfaat bagi kader-kader posyandu dalam menjalankan tugasnya,&rdquo; kata Anwar.&nbsp;</p>\n\n<p>Hal senada juga disampaikan kepala Badan Pengelola Ligkungan Hidup Lilis Sukartini dan Camat Bogor Timur Taufik yang ditemui di sela-sela acara &ldquo;Kami sangat mengapresiasi dengan apa yang sudah dilakukan oleh Direktorat Penataan Bangunan dan Lingkungan Kementrian Pekerjaan Umum RI,&rdquo; ujar Lilis dan Taufik. (Tria S).</p>\n\n<p>Editor :sastro</p>\n', '2015-12-23 09:08:56', '2014-09-20', 30, 1, ''),
(18, 3, 13, 'Tugas Pokok dan Fungsi', '<p>Melaksanakan kebijakan dibidang Lingkungan Hidup.</p>\r\n\r\n<p>1. Perumusan kebijakan teknis dibidang Pengelolaan Lingkungan Hidup;<br />\r\n2. Pemberian dukungan atas penyelenggaraan Pengelolaan Lingkungan Hidup;<br />\r\n3. Pembinaan dan pelaksanaan Pengelolaan Lingkungan Hidup;<br />\r\n4. Pelaksanaan tugas lain yang diberikan oleh Walikota sesuai dengan tugas dan fungsinya.</p>\r\n', '2015-07-27 17:43:07', '2015-01-03', 0, 1, ''),
(19, 5, 7, '12 Kepala Daerah Sepakati Tri Karsa Bogor ', '<p><img alt="" src="http://bplh.kotabogor.go.id/uploads/content/images/potobersamakbnry1111.jpg" style="float:left; height:120px; margin-left:5px; margin-right:5px; width:240px" />Pertemuan Informal Kepala Daerah Untuk Pembangunan Yang Berkelanjutan di Green Garden Cafe dan Resto Kebun Raya Bogor pada Senin (15/6) menghasilkan kesepakatan yang tertuang dalam Tri Karsa Bogor. Ke dua belas kepada daerah atau perwakilannya telah menandatangani Tri Karsa Bogor, setelah membahasnya selama kurang lebih dua jam.&nbsp;</p>\n\n<p>Ke-12 kepala daerah tersebut, adalah Kota Bogor selaku tuan rumah,Padang, Kupang, Tanggerang Selatan, Tanggerang, Makasar, Balikpapan, Pekalongan, Manado, Banda Aceh dan Bontang. Berikut secara rinci hal-hal yang tertuang dalam Tri Karsa Bogor beorientasi pada pembangunan yang ramah lingkungan:</p>\n\n<p>Para Kepala Daerah yang hadir bertekad untuk bekerja keras agar dapat mewujudkan pembangunan daerah yang maju dan berdaya saing sehingga dapat menjadi pilar pertumbuhan ekonomi nasional, memastikan semua elemen masyarakat mendapatkan manfaat pembangunan, serta menjamin agar upaya tersebut tidak menimbulkan dampak merugikan bagi lingkungan hidup serta tidak mengancam kelestarian lingkungan.&nbsp;</p>\n\n<p>Untuk mendukung &nbsp;tekad tersebut kepala daerah berkomitmen untuk mewujudkan pembanguan yang rendah emisi, meminimalisir dampak pembangunan dan mereduksi kontribusi terhadap peningkatan emisi gas rumah kaca penyebab perubahan iklim. Juga memastikan seluruh elemen wilayah perkotaan - perdesaan didaerah agar mampu beradaptasi terhadap perubahan yang terjadi akibat perubahan iklim. Serta menjamin sistem perkotaan - perdesaan tetap berjalan dan memberikan pelayanan kepada publik jika terjadi goncangan dan tekanan akibat bencana maupun perubahan iklim melalui penyusunan strategi ketahanan yang komprehensif dan menyeluruh.&nbsp;</p>\n\n<p>Dalam mendukung dan mengaplikasi visi, tekad dan komitmen-komitmen yang telah disepakati, para Kepala Daerah menjalin kemitraan ICLEI-Local Gobernments for Sustainability untuk melakukan aksi-aksi nyata sebagai berikut: &nbsp;</p>\n\n<ul>\n	<li>meningkatkan kerja sama dan kolaborasi diantara kepala daerah di Indonesia dengan membentuk forum komunikasi kepada daerah yang memiliki visi untuk mewujudkan pembangunan yang berkelanjutan.</li>\n	<li>memperluas jaringan dengan kepala daerah dan pemimpin pemerintahan lokal lainnya di seluruh dunia yang memiliki visi serupa.</li>\n	<li>menyusun Rencana Aksi Transformatif pembangunan daerah yang rendah emisi dan berketahanan iklim.</li>\n	<li>secara sukarela akan melaporkan secara aktif penjabaran rencana aksi tersebut dan capaian-capaian melalui platform Carbon Climate Registry yang dikembangkan oleh ICLEI-Local Gobernments for Sustainability.</li>\n</ul>\n\n<p>Selain itu, ke-12 kepala daerah yang hadir juga menghendaki agar pemerintah pusat mendelegasikan kewenangan dengan memberikan ruang bagi diskresi pemerintah daerah dan memberikan perlindungan hukum kepada Walikota/ Bupati dan/ atau aparatur pemerintahan daerah lainnya yang bekerja mencapai target adaptasi dan mitigasi perubahan iklim. (tim humas)</p>\n', '2015-12-23 09:08:28', '2015-06-15', 18, 1, ''),
(20, 5, 12, 'VISI DAN MISI', '<p>Visi dan Misi BPLH Kota Bogor dilakukan dengan memperhatikan isu lingkungan strategis yang saat ini dihadapi oleh Kota Bogor, visi, misi, tujuan, sasaran dan arah pembangunan Kota Bogor yang dinyatakan dalam RPJMD Kota Bogor 2015-2019.</p>\r\n\r\n<p><span style="line-height:1.6em">VISI :</span></p>\r\n\r\n<p><em>&ldquo;Mewujudkan Pengelolaan Lingkungan Hidup Yang Berkualitas Menuju Kota Bogor Yang Berwawasan Lingkungan&rdquo;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>MISI :</p>\r\n\r\n<ol>\r\n	<li><em>Meningkatkan Pengendalian Pencemaran dan/ atau kerusakan Lingkungan Hidup dalam rangka pelestarian lingkungan hidup.</em></li>\r\n	<li><em>Meningkatkan </em><em>Pengelolaan Sumber Daya Alam dan Lingkungan Hidup yang terintegrasi</em></li>\r\n	<li><em>Me</em><em>wujudkan Peningkatan Peran dan Partisipasi Masyarakat.</em></li>\r\n	<li><em>Mewujudkan Penataan dan Penegakkan Hukum Lingkungan.</em></li>\r\n	<li><em>Meningkatkan Kualitas Sumberdaya Manusia dan Data Serta Penyediaan Informasi Lingkungan.</em></li>\r\n</ol>\r\n', '2015-08-03 04:15:26', '2015-01-04', 0, 1, ''),
