(88, 5, 7, 'Aksi Menanam 500 Pohon pada Hari Menanam Pohon', '<p>Sabtu, 28 November 2015, Walikota Bogor, DR. Bima Arya, Wakil Walikota Bogor, Ir. Usmar Hariman, Sekretaris Daerah Kota Bogor, Drs. Ade Sarip Hidayat, M.Pd., mengawali Hari Menanam Pohon Tingkat Kota Bogor dengan aksi menanam pohon di RPH Bubulak. Hadir pada acara tersebut para kepala OPD se Kota Bogor.</p>\n\n<p>Dalam acara tersebut juga dilakukan penyerahan penghargaan pada perusahaan yang berperan serta dalam pengelolaan lingkungan hidup. Turut serta dalam aksi penanaman pohon tersebut antara lain para pelajar SMA, dan anggota Saka Kalpataru.</p>\n\n<p>&nbsp;</p>\n', '2015-12-22 13:48:43', '2015-11-28', 41, 1, '20151222388.jpg'),
(90, 9, 30, 'Data Mata Air di Kota Bogor tahun 2016', '<p>contoh</p>\n', '2016-02-24 11:05:42', '2016-02-24', 0, 1, '');
