INSERT INTO `tahunuji_ambien` (`tahunuji_ambien`, `keterangan`) VALUES
('2010', '<p>Baku Mutu : &nbsp;Peraturan Pemerintah Republik Indonesia No. 41 Tahun 1999 tentang Pengendalian Pencemaran Udara&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Surat Keputusan Gubernur KDH Tingkat I Jawa Barat No. 60.31/SK.694-BKPMD/1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
('2011', '<p>Baku Mutu &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: &nbsp; Peraturan Pemerintah Republik Indonesia No. 41 Tahun 1999 tentang Pengendalian Pencemaran UdaraSurat Keputusan Gubernur &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;KDH Tingkat I Jawa Barat No. 60.31/SK.694-BKPMD/1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nParameter yang melebihi Baku Mutu &nbsp;&nbsp; &nbsp;: - Debu, TSP</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;Kebisingan</p>\r\n\r\n<p>Kesimpulan</p>\r\n\r\n<p>1. Kegiatan Pengujian Kualitas Udara Ambien di Kota Bogor Tahun Anggaran 2011 dilakukan terhadap 30 titik lokasi pengambilan sampel udara yang meliputi pekerjaan : &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pengukuran Parameter Kualitas Udara Ambien dilapangan dan Analisa Laboratorium terhadap sampel kualitas udara.&nbsp;</p>\r\n\r\n<p>2. Parameter kualitas udara yang melebihi Nilai Ambang Batas&nbsp;kadar debu yang dipesryaratkan (230 &micro;g/Nm&sup3;).&nbsp;</p>\r\n\r\n<p>3. Berdasarkan lokasi, kadar parameter debu yang masih dibawah nilai ambang batas adalah Pertigaan Jalan Gunung Batu, Perempatan CIFOR, Patung Narkoba, Pertigaan &nbsp; &nbsp; &nbsp; Talang dan Perempatan Hotel Pangrango, sedangkan 25 lokasi lainnya di wilayah Kota Bogor relatif sudah di ambang batas kadar debu yang dipersyaratkan.</p>\r\n\r\n<p>3. Hasil pengujian parameter CO, SO&times; dan NO&times; yang relatif tinggi diperoleh di Pertigaan Empang (Jalan Pahlawan - Jalan Emapang), sedangkan kadar parameter yang relatif &nbsp; &nbsp; terendah adalah lokasi Pertigaan Junggle&nbsp;Park (Jalan Pahlawan Bondongan).</p>\r\n\r\n<p>4. Lokasi yang memiliki tingkat pencemaran timah &nbsp;Pb yang relatif tinggi namun masih dibawah &nbsp;nilai ambang batas (2 &micro;g/Nm&sup3;) adalah : Batas Kota Arah Tanah Sareal, Pertigaan Plaza Bogor Trader Mall, Pertigaan Pacasan, Pertigaan Warung Jambu, Pertigaan Pasar Mawar, Pertigaan Jembatan Merah, Pertigaan Taman Topi, Pertigaan Eampang, Jalan Pajajaran depan Hero Super Market dan Putaran Bogor Trade Mall ( Jalan Ir. H.Juanda).</p>\r\n\r\n<p>5. Hasil pengujian &nbsp;parameter kebisingan di setiap titik lokasi pengukuran menunjukan nilai yang relatif tinggi dan berada di atas baku mutu yang dipersyaratkan.</p>\r\n\r\n<p>6. Hasil pemantauan kualitas udara ambien melalui pengujian yang dilakukan di lapangan dan laboratorium menunjukan indikasi yang relatif tidak membahayakan bagi lingkungan karena partikulat udara dan gas - gas&nbsp;yang ada tersebut umumnya masih dibawah ambang batas baku mutu kualitas udara.</p>\r\n\r\n<p>7. Penilaian dilakukan berdasarkan kriteria baku mutu kualitas udara ambient sesuai dengan peraturan pemerintah Nomor 41 Tahun 1999 tentang Pengendalian Pencemaran Udara dan berdasarkan Surat Keputusan&nbsp;Gubernur KDH Tingkat I Propinsi Jawa Barat No. 60.31 / SK. 694 - BKPMD / 1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
('2012', '<p>Baku Mutu &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;: &nbsp;Peraturan Pemerintah Republik Indonesia No. 41 Tahun 1999 tentang Pengendalian Pencemaran Udara&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Kebisingan&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; Surat Keputusan Gubernur KDH Tingkat I Jawa Barat No. 60.31/SK.694-BKPMD/1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nParameter yang melebihi Baku Mutu : - Debu, TSP</p>\r\n\r\n<p>Kegiatan pengujian kualitas udara di Kota Bogor pada tahun anggaran 2012, dapat diambil kesimpulan sebagai berikut :&nbsp;</p>\r\n\r\n<p>1. Sampel kualitas udara ambient yang diambil sebanyak 30 lokasi di Kota Bogor dan untuk tahun anggaran 2012 dilaksanakan pengambilan sampel udara emisi cerobong untuk kegiatan Industri sebanyak 4 kegiatanusaha/Industri yang ada di Kota Bogor.</p>\r\n\r\n<p>2. Kualitas udara ambient untuk parameter &nbsp;debu, hampir disetiap titik lokasi pengambilan menunjukan hasil yang relative tinggi terhadap baku mutu namun masih berada dibawah baku mutu yang dipersyaratkan dan terdapat satu lokasi pengambilan sampel yang melebihi baku mutu yaitu di Perbatasan Kota Arah Bogor Barat Darmaga, hal ini harus diwaspadai dan harus mendapatkan perhatian.</p>\r\n\r\n<p>3. Kualitas udara untuk parameter kebisingan dari semua lokasi pengambilan sampel menunjukan hasil yang melebihi baku mutu yang dipersyaratkan.</p>\r\n\r\n<p>4. Hasil Pengujian kualitas udara emisi terhadap 4 kegiatan usaha atau industri di Kota Bogor menunjukan hasil yang masih dibawah baku mutu udara emisi berdasarkan Permen LH 07/2007 dari empat kegiatan Industri yang diuji.</p>\r\n\r\n<p>5.Kondisi kualitas udara Kota Bogor berdasarkan hasil pemantauan dan pengujian kualitas udara (pada periode pengujian oktober 2012) tersebut , secara umum menunjukan bahwa sebagian besar parameter yang diukur masih belum melebihi kriteria mutu udara ambien.</p>\r\n\r\n<p>6.Penilaian dilakukan berdasarkan kriteria baku mutu kualitas udara ambient sesuai dengan peraturan pemerintah Nomor 41 Tahun 1999 tentang Pengendalian Pencemaran Udara dan berdasarkan Surat Keputusan Gubernur KDH Tingkat I Propinsi Jawa Barat No. 60.31 / SK. 694 - BKPMD / 1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n'),
