kebisingan dari semua lokasi pengambilan sampel menunjukan hasil yang melebihi baku mutu yang dipersyaratkan.</span></p>\r\n\r\n<p>4.Hasil Pengujian kualitas udara emisi terhadap 4 kegiatan usaha atau industri di Kota Bogor menunjukan hasil yang masih dibawah baku mutu udara emisi berdasarkan Permen LH 07/2007 dari empat kegiatan Industri yang diuji.</p>\r\n\r\n<p>5.Kondisi kualitas udara Kota Bogor berdasarkan hasil pemantauan dan pengujian kualitas udara (pada periode pengujian oktober 2012) tersebut , secara umum menunjukan bahwa sebagian besar parameter yang diukur masih belum melebihi kriteria mutu udara ambien.</p>\r\n\r\n<p>6.Penilaian dilakukan berdasarkan kriteria baku mutu kualitas udara ambient sesuai dengan peraturan pemerintah Nomor 41 Tahun 1999 tentang Pengendalian Pencemaran Udara dan berdasarkan Surat Keputusan Gubernur KDH Tingkat I Propinsi Jawa Barat No. 60.31 / SK. 694 - BKPMD / 1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n'),
('2014', '<p>Baku Mutu &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;: &nbsp;Peraturan Pemerintah Republik Indonesia No. 41 Tahun 1999 tentang Pengendalian Pencemaran Udara&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Kebisingan&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; Surat Keputusan Gubernur KDH Tingkat I Jawa Barat No. 60.31/SK.694-BKPMD/1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nParameter yang melebihi Baku Mutu : - Debu, TSP</p>\r\n\r\n<p>Kegiatan pengujian kualitas udara di Kota Bogor pada tahun anggaran 2012, dapat diambil kesimpulan sebagai berikut:</p>\r\n\r\n<p>1.Sampel kualitas udara ambient yang diambil sebanyak 30 lokasi di Kota Bogor dan untuk tahun anggaran 2012 dilaksanakan pengambilan sampel udara emisi cerobong untuk kegiatan Industri sebanyak 4 kegiatan usaha/Industri yang ada di Kota Bogor.</p>\r\n\r\n<p>2.Kualitas udara ambient untuk parameter &nbsp;debu, hampir disetiap titik lokasi pengambilan menunjukan hasil yang relative tinggi terhadap baku mutu namun masih berada dibawah baku mutu yang dipersyaratkan danterdapat satu lokasi pengambilan sampel yang melebihi baku mutu yaitu di Perbatasan Kota Arah Bogor Barat Darmaga, hal ini harus diwaspadai dan harus mendapatkan perhatian.</p>\r\n\r\n<p>3.Kualitas udara untuk parameter kebisingan dari semua lokasi pengambilan sampel menunjukan hasil yang melebihi baku mutu yang dipersyaratkan.</p>\r\n\r\n<p>4.Hasil Pengujian kualitas udara emisi terhadap 4 kegiatan usaha atau industri di Kota Bogor menunjukan hasil yang masih dibawah baku mutu udara emisi berdasarkan Permen LH 07/2007 dari empat kegiatan Industri yang diuji.</p>\r\n\r\n<p>5.Kondisi kualitas udara Kota Bogor berdasarkan hasil pemantauan dan pengujian kualitas udara (pada periode pengujian oktober 2012) tersebut , secara umum menunjukan bahwa sebagian besar parameter yang diukur masih belum melebihi kriteria mutu udara ambien.</p>\r\n\r\n<p>6.Penilaian dilakukan berdasarkan kriteria baku mutu kualitas udara ambient sesuai dengan peraturan pemerintah Nomor 41 Tahun 1999 tentang Pengendalian Pencemaran Udara dan berdasarkan Surat Keputusan Gubernur KDH Tingkat I Propinsi Jawa Barat No. 60.31 / SK. 694 - BKPMD / 1982 tentang Baku Mutu Gas H2S, NH3 dan Kebisingan. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n');
