INSERT INTO `tahunuji_sungai` (`tahunuji_sungai`, `keterangan`) VALUES
('2010', 'Hasil Pengujian sebagai bb..'),
('2011', 'Hasil Pengujian sebagai bb..'),
('2012', 'Hasil Pengujian sebagai bb..'),
('2013', 'Hasil Pengujian sebagai bb..'),
('2014', '<p>Kesimpulan&nbsp;&nbsp; &nbsp;<br />\r\na. Pemantauan kualitas sungai di 27 titik lokasi pemantauan dari 2 (dua)<br />\r\n&nbsp;&nbsp; &nbsp;aliran sungai di Kota Bogor yaitu Sungai Ciliwung dan Sungai Cisadane<br />\r\n&nbsp;&nbsp; &nbsp;beserta sungainya. Anak sungai ciliwung yaitu sungai Cibalok, Sungai<br />\r\n&nbsp;&nbsp; &nbsp;Ciparigi , dan Sungai Ciluar, Anak sungai Cisadane yaitu sungai Cisindang,<br />\r\n&nbsp;&nbsp; &nbsp;Barang, Sungai Cipakancilan dan sungai Cidepit. Secara keseluruhan&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;dapat disimpulkan bahwa pada pemantauan tahun 2014 ada beberapa<br />\r\n&nbsp;&nbsp; &nbsp;parameter yang melebihi baku mutu yaitu TSS dan BOD. Untuk parameter<br />\r\n&nbsp;&nbsp; &nbsp;BOD hampir di semua titik pemantauan melebihi baku mutu yang telah<br />\r\n&nbsp;&nbsp; &nbsp;ditentukan, Dari hasil analisa laboratorium selama dua periode, periode<br />\r\n&nbsp;&nbsp; &nbsp;I hasilnya cenderung lebih besar daripada periode II. Dari hasil perhitungan<br />\r\n&nbsp;&nbsp; &nbsp;Indeks Pencemar, secara keseluruhan dari semua lokasi pemantauan&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;sungai di Kota Bogor rata-rata tercemar ringan, namun perhitungan<br />\r\n&nbsp;&nbsp; &nbsp;indeks pencemar adalah menggambarkan kondisi saat ini, apabila dilihat<br />\r\n&nbsp;&nbsp; &nbsp;secara keseluruhan dari pemantauan periode-periode sebelumnya<br />\r\n&nbsp;&nbsp; &nbsp;berdasarkan perhitungan storet maka sungai-sungai di Kota Bogor<br />\r\n&nbsp;&nbsp; &nbsp;termasuk kategori tercemar berat.<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nb. &nbsp;Berdasarkan hasil analisis trend kualitas air sungai di Kota Bogor dari<br />\r\n&nbsp;&nbsp; &nbsp;tahun 2010-2014 trend nya meningkat, namun pada beberapa parameter<br />\r\n&nbsp;&nbsp; &nbsp;nilainya menurun pada pemantauan tahun 2014.<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nc. Dari hasil pemantauan kualitas situ di Kota Bogor yang terdiri dari 3 situ<br />\r\n&nbsp;&nbsp; &nbsp;yang dipantau yaitu situ Situ Gede, siu Panjang dan Situ Anggalena<br />\r\n&nbsp;&nbsp; &nbsp;masing-masing situ diambil 2 titik yaitu pada inlet dan outlet selama<br />\r\n&nbsp;&nbsp; &nbsp;2 periode pengambilan didapatkan hasil beberapa parameter yang&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;melebihi baku mutu yaitu COD, BOD, TSS dan Koliform tinja pada inlet<br />\r\n&nbsp;&nbsp; &nbsp;situ Anggalena. Secara perhitungan Indeks Pencemar didapatkan hasil<br />\r\n&nbsp;&nbsp; &nbsp;semua titik lokasi pemantauan Situ termasuk kategori tercemar ringan.<br />\r\n&nbsp;&nbsp; &nbsp;Hasil pemantauan periode I cenderung lebih besar dari pada periode II.<br />\r\n&nbsp;&nbsp; &nbsp;Perhitungan Indek Pencemar merupakan gambaran kondisi sesaat saat<br />\r\n&nbsp;&nbsp; &nbsp;pengambilan sampel, berdasarkan perhitungan storet situ Gede termasuk<br />\r\n&nbsp;&nbsp; &nbsp;kategori tercemar berat, Situ Panjang termasuk kategori tercemar sedang<br />\r\n&nbsp;&nbsp; &nbsp;untuk inletnya, sedangkan Situ Anggalena tidak dihitung storetnya<br />\r\n&nbsp;&nbsp; &nbsp;karena datang kurang memenuhi, hanya ada pemantauan periode tahun<br />\r\n&nbsp;&nbsp; &nbsp;2014.<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nd. Dari hasil analisis trend kualitas air situ di Kota Bogor yang terdiri dari<br />\r\n&nbsp;&nbsp; &nbsp;Situ Gede, Situ Panjang dan Situ Anggalena secara umum trend nya&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;meningkat dari tahun 2010-2013, namun dari tahun 2013-2014 cenderung<br />\r\n&nbsp;&nbsp; &nbsp;menurun.<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\ne. Dari hasil pemantauan kualitas air tanah di 30 lokasi di 6 kecamatan di<br />\r\n&nbsp;&nbsp; &nbsp;Kota Bogor didapatkan hasil analisa laboratorium air sumur diseluruh&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;lokasi pemantauan menunjukkan bahwa kualitas air sumur di Kota Bogor<br />\r\n&nbsp;&nbsp; &nbsp;relative baik. Namun, masih ada beberapa titik pemantauan yang&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;parameternya melebihi baku mutu, yaitu; Kelurahan Cilendek Barat di<br />\r\n&nbsp;&nbsp; &nbsp;Kediaman Bapak Husen RT. 01/02. Parameter pH ada yang kurang dari<br />\r\n&nbsp;&nbsp; &nbsp;batas minimal yang ditentukan yangitu, 6,5 berada di titik pemantauan<br />\r\n&nbsp;&nbsp; &nbsp;Kelurahan Panaragan RT.05/01 di Kediaman Bapak Jupri, Kelurahan<br />\r\n&nbsp;&nbsp; &nbsp;Bojong Kerta di Kediaman Ibu Ihat &nbsp;RT.04/03, Kelurahan Sindangrasa<br />\r\n&nbsp;&nbsp; &nbsp;RT.04/07 di Kediaman Bapak M. Ali, dan Kelurahan Sindangsari RT.03/01<br />\r\n&nbsp;&nbsp; &nbsp;di Kediaman Ibu Iyum. Parameter Coliform Tinja hanja ada di satu titik<br />\r\n&nbsp;&nbsp; &nbsp;pemantauan yaitu Kelurahan Ciparigi di Sumur dekat lapangan bola.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
('2015', 'Hasil Pengujian sebagai bb..');
